#A quick and dirty wrapper for rubeus
function Invoke-Rubeus{

    [CmdletBinding()]
    Param (
        [Parameter(Position = 0, Mandatory = $true)]
        [ValidateNotNullorEmpty()]
        [String]
        $Command
    )

    
$raw=""

$RAS = [System.Reflection.Assembly]::Load([Convert]::FromBase64String($raw))

[Rubeus.Program]::Main($Command.Split(" "))

}

